    def search(i, j, data):
        if grid[i][j] == '#':
            data[0] += 1
        else:
            data[1] += 1
        avail[i][j] = False
        if i + 1 <= H and grid[i + 1][j] != grid[i][j] and avail[i + 1][j]:
            search(i + 1, j, data)
        if j + 1 < W and grid[i][j + 1] != grid[i][j] and avail[i][j + 1]:
            search(i, j + 1, data)
        if i > 0 and grid[i][j] != grid[i - 1][j] and avail[i - 1][j]:
            search(i - 1, j, data)
        if j > 0 and grid[i][j] != grid[i][j - 1] and avail[i][j - 1]:
            search(i, j - 1, data)
    ans = 0
    for i in range(H):
        for j in range(W):
            if avail[i][j]:
                data = [0, 0]
                search(i, j, data)
                ans += data[0] * data[1]
    return ans

